import React from 'react'

export default function Content() {
    const products = [
        {name: "Product 1", price: 35, url: "https://picsum.photos/id/1/200/300"},
        {name: "Product 2", price: 45, url: "https://picsum.photos/id/2/200/300"},
        {name: "Product 3", price: 55, url: "https://picsum.photos/id/3/200/300"}
    ]
  return (
    <div style = {{display:"flex", justifyContent:"center"}}>
        {products.map((value, index) => (
            <div style={{backgroundColor: "cyan", margin: "10px", padding: "10px"}}>
                <h2 key={index}>{value.name}</h2>
            </div>
        ))}
    </div>
  )
}
